// 1) pega a hora “agora” convertida para SP
const nowSP = new Date(
  new Date().toLocaleString('en-US', { timeZone: 'America/Sao_Paulo' })
);

// 2) subtrai um dia (para virar “ontem”)
nowSP.setDate(nowSP.getDate() - 1);

// 3) monta a string “YYYY-MM-DD”
const yyyy = nowSP.getFullYear();
const mm   = String(nowSP.getMonth() + 1).padStart(2, '0');
const dd   = String(nowSP.getDate()).padStart(2, '0');
const yesterday = `${yyyy}-${mm}-${dd}`;

// 4) filtra apenas os items cuja Date === yesterday
const itemsYesterday = items.filter(item => item.json.Date === yesterday);

// 5) devolve no formato que o n8n espera
return itemsYesterday.map(item => ({ json: item.json }));
